import { createApp } from 'vue'
import App from './App.vue'
import { BootstrapVue3} from 'bootstrap-vue-3'
import router from './router'
import Vuex from 'vuex'
import createPersistedState from 'vuex-persistedstate'

import 'bootstrap/dist/css/bootstrap.css'
import 'bootstrap-vue-3/dist/bootstrap-vue-3.css'

export const store = new Vuex.Store({
    plugins: [createPersistedState({
        storage: window.sessionStorage,
    })],
    state: {
        list: [{ id: 0, text: "test1",img:"data:image/jpeg;base64,",descr:"- " }, 
        { id: 1, text: "test2",img:"data:image/jpeg;base64,",descr:"- 2" },
        { id: 2, text: "test3",img:"data:image/jpeg;base64,",descr:"- 2" },
        { id: 3, text: "test4",img:"data:image/jpeg;base64,",descr:"- 2" }]
    },
    mutations: {
        edit(state, newList) {
            state.list = newList
        }
    },
    actions: {
        editList({ commit }, list) {
            commit("edit", list)
        }
    }
});

createApp(App).use(BootstrapVue3).use(router).use(store).mount('#app')
